  \"Environmental contaminants in tissues from an Atlantic sturgeon (Acipenser oxyrinchus)
  recovered in Wellfleet, Massachusetts\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  2,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:48:53.059311\",\n\t\"name\": \"environmental-contaminants-in-tissues-from-an-atlantic-sturgeon-acipenser-oxyrinchus-recov\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"On February 2, 2007, a family walking along
  a Cape Cod beach in Wellfleet, Massachusetts, came upon a large dead sturgeon in
  the sand. Since very little information is available regarding contaminant burdens
  in Atlantic sturgeon from the New England area, the National Marine Fisheries Service
  (NMFS) funded an Interagency Agreement with the U.S. Fish and Wildlife Service (USFWS)
  so contaminant concentrations in muscle, liver, and gonad samples from the sturgeon
  carcass could be determined. Single samples of each tissue type were analyzed for
  dioxins, furans, polychlorinated biphenyl (PCBs), polychlorinated diphenyl ethers
  (PBDEs), other organic compounds (e.g., DDT, chlordanes), trace metals (e.g., arsenic,
  mercury, lead), and lipid content. Dioxin toxic equivalent (TCDDu2010TEQs) values,
  which are an expression of combined concentrations of dioxins, furans, and dioxinu2010like
  PCB congeners, were determined in each tissue sample.\",\n\t\"license_title\": \"License
